import React, { Component } from 'react'
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { createMuiTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core//Typography'
import red from '@material-ui/core/colors/red'
import { Button } from '@material-ui/core';

const styles = {
    button: {
        margin: 15,
    },
};


const theme = createMuiTheme({
    palette: {
        primary: {
            main: red['A700']
        },
        secondary: {
            main: red[900]
        }
    }
});

export class Confirm extends Component {
    render() {
        const { values: { user, password, email, placeName, placeDescription, placePhone }
        } = this.props;
        console.log(this.state.user)
        return (
            <MuiThemeProvider theme={theme}>
                <React.Fragment>
                    <AppBar position="static" color="primary" >
                        <Toolbar >
                            <Typography variant="h5">
                                WebMenu
                            </Typography>
                        </Toolbar>
                    </AppBar>
                    <br />
                    <Button variant="contained" color="inherit" style={styles.button} href="/sucess">
                        Salvar
                    </Button>
                    <Button variant="contained" color="primary" style={styles.button} href="/cadastro">
                        Voltar
                    </Button>
                </React.Fragment>

            </MuiThemeProvider>
        )
    }
}

export default Confirm
